// frontend/src/components/Pages/HomePage.js
import React from 'react';

function HomePage() {
  return (
    <div>
      <h2>Página Inicial</h2>
      <p>Aqui teremos os anúncios em destaque e próximos a você.</p>
    </div>
  );
}

export default HomePage;
